import{_ as t,c as a,o,ag as i}from"./chunks/framework.ymCRTBvy.js";const _=JSON.parse('{"title":"创建第一个SwiftUI项目","description":"","frontmatter":{},"headers":[],"relativePath":"base/1.2_创建第一个SwiftUI项目.md","filePath":"base/1.2_创建第一个SwiftUI项目.md"}'),r={name:"base/1.2_创建第一个SwiftUI项目.md"};function n(s,e,l,c,d,p){return o(),a("div",null,e[0]||(e[0]=[i('<h1 id="创建第一个swiftui项目" tabindex="-1">创建第一个SwiftUI项目 <a class="header-anchor" href="#创建第一个swiftui项目" aria-label="Permalink to &quot;创建第一个SwiftUI项目&quot;">​</a></h1><h2 id="启动xcode并创建新项目" tabindex="-1">启动Xcode并创建新项目 <a class="header-anchor" href="#启动xcode并创建新项目" aria-label="Permalink to &quot;启动Xcode并创建新项目&quot;">​</a></h2><p>恭喜你！🎉 准备好踏上SwiftUI的奇妙旅程了吗？首先，你需要启动Xcode。在你的Mac上找到Xcode图标，点击它，或者通过Spotlight搜索“Xcode”来打开。</p><p>一旦Xcode启动，你会看到一个欢迎界面。在这里，你将选择“Create a new Xcode project”（创建一个新的Xcode项目）。这会引导你进入项目模板选择界面。</p><h2 id="选择项目模板" tabindex="-1">选择项目模板 <a class="header-anchor" href="#选择项目模板" aria-label="Permalink to &quot;选择项目模板&quot;">​</a></h2><p>在项目模板选择界面，你会看到多种应用类型。对于我们的第一个SwiftUI项目，请确保选择“iOS”选项卡下的“App”模板。这个模板是构建标准iOS应用的基础。</p><p>点击“Next”（下一步）继续。你现在需要为你的新项目填写一些基本信息。这些信息对于项目的正确设置至关重要。</p><h2 id="配置项目选项" tabindex="-1">配置项目选项 <a class="header-anchor" href="#配置项目选项" aria-label="Permalink to &quot;配置项目选项&quot;">​</a></h2><p>现在，是时候为你的第一个SwiftUI应用命名了！在“Product Name”（产品名称）字段中，输入你喜欢的应用名称，例如“MyFirstSwiftUIApp”。这个名字将显示在你的设备主屏幕上。</p><ul><li><strong>Team（团队）</strong>: 如果你已经登录了Apple开发者账户，这里会自动显示你的团队。如果没有，你可以选择“None”（无）。</li><li><strong>Organization Identifier（组织标识符）</strong>: 这通常是你的公司或个人域名的反向形式，例如“com.yourcompany”。它与产品名称结合，形成一个唯一的Bundle Identifier。</li><li><strong>Interface（界面）</strong>: <strong>务必选择“SwiftUI”</strong>。这是我们构建界面的核心框架。</li><li><strong>Language（语言）</strong>: <strong>务必选择“Swift”</strong>。这是我们编写代码的语言。</li><li><strong>Storage（存储）</strong>: 保持默认的“None”（无）。</li><li><strong>Include Tests（包含测试）</strong>: 暂时取消勾选，我们稍后会学习测试。</li></ul><p>填写完毕后，点击“Next”。</p><h2 id="保存项目" tabindex="-1">保存项目 <a class="header-anchor" href="#保存项目" aria-label="Permalink to &quot;保存项目&quot;">​</a></h2><p>Xcode会要求你选择一个位置来保存你的项目。选择一个你容易找到的文件夹，例如“Documents”或“Desktop”。建议你创建一个专门的文件夹来存放所有的SwiftUI项目。</p><p>点击“Create”（创建），Xcode就会为你生成所有的项目文件。几秒钟后，你将看到Xcode的主界面，你的第一个SwiftUI项目已经成功创建了！🥳</p><p>你现在已经迈出了SwiftUI学习的第一步，是不是很激动呢？接下来，我们将深入了解这个项目的结构。</p>',15)]))}const h=t(r,[["render",n]]);export{_ as __pageData,h as default};
